import React, { FunctionComponent } from "react";
import popo from "../Assets/img/logo1.jpg";
import './MyHeader.css'

class MyHeader extends React.Component{
    render() {
        return (
            <>
            <div className="nav">
                <div className="navgauche">
                <img src={popo} alt="" />

                </div>
                <div className="navdroite">
                    <div className="navdroitehaut">

                    </div>
                    <div className="navdroitebas">
                        <a href="#">HOME</a>
                        <a href="#">PAGES</a>
                        <a href="#">SERVICES</a>
                        <a href="#">SHOP</a>
                        <a href="#">NEW</a>
                        <a href="#">CONTACT</a>
                    </div>
                </div>
            </div>
            <div className="banniere">
                <h1>Classified</h1>
            </div>
            <p>Coucou</p>
            </>
        );
    }
}

export default MyHeader;
